import React from 'react';
import captureimg from '../img/capture.svg';
import './Feature.css';
import FeaturesItem from './FeaturesItem';
 

function Features (props) {
    return(
        <div className='col-md-3'>
            <div className= {"feature-item" + " " +props.addclass}> 
               <div className='icon'>
                    <img src={FeaturesItem.Featuresimg} alt='icon' />
               </div>
               <h3>{props.TitleName}</h3>
               <p>{props.Decription}</p>
            </div>
        </div>
    );
}
export default Features;
